class AttributeForAllNotes:
    def __init__(self, c, i, d, x, e, f, q, g, r, a, b, h):
        self.c = c; self.i = i; self.d = d; self.x = x; self.e = e; self.f = f;
        self.q = q; self.g = g; self.r = r; self.a = a; self.b = b; self.h = h;

key_colors = AttributeForAllNotes(
    c = (  0,255,255), i = (  0,128,255), d = (  0,  0,255), x = (128,  0,255),
    e = (255,  0,255), f = (192,  0, 96), q = (255,  0,  0), g = (255,128,  0),
    r = (192,192,  0), a = (192,255,  0), b = (  0,192,  0), h = (  0,128, 96),
)

key_labels = AttributeForAllNotes(
    c = "C", i = " I",d = "D", x = "X", e = "E", f = "F",
    q = "Q", g = "G", r = "R", a = "A", b = "B", h = "H",
)

key_label_colors = AttributeForAllNotes(
    c = (  0,  0,  0), i = (  0,  0,  0), d = (255,255,255), x = (255,255,255),
    e = (  0,  0,  0), f = (255,255,255), q = (  0,  0,  0), g = (  0,  0,  0),
    r = (  0,  0,  0), a = (  0,  0,  0), b = (  0,  0,  0), h = (255,255,255),
)

